(6441, 'MLM628983503', 'MLM113047', '755.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Incluye postes de red expansibles y retráctiles con 2 raquetas, 2 bolas y una bolsa de malla para transportarla\nVersátil, se ajusta a cualquier superficie con el área de una mesa medidas 190 cm de ancho por 4.4 cm de grosor\nDiseño compacto fácil de almacenar y llevar\nSe arma en segundos\nIdeal para usar en casa o para lleva', '1', '2019-05-17 22:54:12', '0000-00-00 00:00:00'),
