(7161, 'MLM629635139', 'MLM118436', '701.00', 'MXN', 99, 'buy_it_now', 'gold_pro', '¡¡¡IMPORTANTE!!!!          \n          \nTodos nuestros productos tienen envío GRATIS          \n          \nSeleccionar la opción de \"RETIRO EN DOMICILIO DEL VENDEDOR\" y nosotros te mandaremos mensaje para que nos proporciones tus datos de envío          \n          \n*El envío es por paquetería privada o por DHL          \n**Se cuenta con la opción de envío express teniendo un costo de $50 pesos extra y un tiempo de entrega al siguiente día (pregunta por disponibilidad).          \n***Evita la cancelación de tu compra por no escoger la opción de RETIRO EN DOMICILIO DEL VENDEDOR.   \n\nCaracterísticas:\nAmazonBasics mochila estilo marinero grande\nViaja fácilmente con cargas extragrandes gracias a AmazonBasics . La bolsa amplia y abatible presenta una forma rectangular y asas de lazo superiores para una elevación y un transporte cómodos. Su cremallera duradera se desliza por tres lados (un extremo, en el centro longitudinalmente y por el otro extremo), lo que facilita el acceso al interior para organizar o acceder a los elementos almacenados.\n\nEl AmazonBasics mochila viene en una variedad de colores lisos y sólidos para una apariencia elegante y una fácil coordinación con otros equipos de viaje. Mide 32.5 por 17 por 11.5 pulgadas (LxWxH).\n\nCARACTERÍSTICAS:\n*Ligero, pero duradero\nHecho de 100 por ciento de nylon, la bolsa de lona pesa solo alrededor de una libra, sin embargo, ofrece una resistencia excepcional. Con una capacidad de hasta 50 libras, la bolsa de lona duradera de nylon ofrece una solución para transportar grandes cargas.\n\n*Espacioso\nCon más de 6.000 pulgadas cúbicas de espacio interior, la gran bolsa de lona AmazonBasics ofrece la capacidad de un baúl, pero sin los lados duros y el peso. Su forma de tronco garantiza la máxima eficacia: espacio suficiente para almacenar objetos y sin desperdicio de oportunidades, como con esquinas redondeadas.\nAún más, la bolsa de lona viene con un bolsillo interior con cremallera para guardar artículos más pequeños como llaves, mientras que su bolsillo de almacenamiento exterior ofrece un cómodo acceso a artículos de último minuto como boletos, itinerarios y más.\n\n*Ideal para viajes o almacenamiento\nUtilice AmazonBasics Large Duffel Bag para transportar objetos personales cuando viaje, envíe a los niños al campamento de verano o la universidad, o simplemente guarde equipos deportivos, ropa de temporada u otros suministros en casa. Cuando no está en uso, la bolsa de lona se pliega en un tamaño plano y compacto, ocupando un espacio mínimo en un estante o en un armario.', '1', '2019-05-17 23:51:46', '0000-00-00 00:00:00'),
