s y bolsos en estado de pánico. El organizador guarda la información importante a mano.\n\n*Protección RFID\nUn componente de seguridad importante para los viajes de hoy en día es el material bloqueador de RFID que protege contra robos electrónicos. La RFID funciona evitando que los ladrones puedan escanear en secreto la información de tu tarjeta de crédito, pasaporte o carnet de conducir.\n\n*Compacto\nCon sus medidas de 25,4 x 12,7 cm, el organizador de viaje con RFID de AmazonBasics ofrece tranquilidad, un tamaño compacto y portátil, y comodidad para viajar de manera eficaz y con estilo.', '1', '2019-05-17 23:55:07', '0000-00-00 00:00:00'),
