(11191, 'MLM623289251', 'MLM1227', '848.00', 'MXN', 99, 'buy_it_now', 'free', 'NOTA: 223 PÁGINAS\n\nMitología nórdica. Con un nuevo propósito y su hijo a su lado, Kratos debe luchar por la supervivencia ya que fuerzas poderosas amenazan con interrumpir la nueva vida que ha creado.\n\nUna crónica íntima de la odisea de años para dar vida al hermoso y brutal mundo de Kratos y Atreus.\n\nIngrese a Midgard y explore más allá, mientras Dark Horse Books y Santa Monica Studio presentan con orgullo el compañero por excelencia del enormemente esperado God of War. Este es un documento diferente a cualquier otro que pone a los lectores en un exhaustivo viaje detrás de escena para presenciar la creación de una épica de tremenda escala.', '1', '2019-05-18 03:03:21', '0000-00-00 00:00:00'),
