(11411, 'MLM623025630', 'MLM4605', '1770.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Philips Norelco Shaver 2100 S1560/81 rasuradora para hombre (Máquina de afeitar de rotación, SH30, Negro, Azul, Batería, Ión de litio, 35 h)\n\nCARACTERÍSTICAS:\n*Práctico, fácil de afeitar Máquina de afeitar eléctrica más cercana en su clase en comparación con otras afeitadoras rotativas y de papel de aluminio de nivel básico\n*Sistema de cuchilla cortada: cuchillas duraderas y autoafilables para un afeitado apurado\n*Cabezas Flex de 4 direcciones: las cabezas se doblan en 4 direcciones para rasurar fácilmente cada curva de la cara y el cuello\n*Potencia de iones de litio: potencia máxima constante año tras año\n*Un toque abierto: la afeitadora puede enjuagarse fácilmente bajo el grifo', '1', '2019-05-18 03:20:58', '0000-00-00 00:00:00'),
(11421, 'MLM623026028', 'MLM189774', '1696.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'ASPEN PET dispensador/bebedero automático de lujo para perro/gato.\nLas mascotas aman el agua fresca que fluye. Fuente purificadora de mascotas ultra silenciosa para múltiples hogares de gatos o perros pequeños, proporciona agua naturalmente fresca y oxigenada. Las características incluyen un filtro reemplazable y un depósito que agrega agua automáticamente.\n\nCaracterísticas:\n*Material de calidad utilizado para la mejor salud de su mascota\n*Diseñado en los EE. UU. Con altos estándares establecidos\n*Confiado por décadas en la industria de las mascotas y estableciendo nuevos estándares\n*Sistema de riego automático para múltiples gatos o perros pequeños\n*El agua en movimiento continuo alienta a las mascotas a beber más agua\n*Recomendado por veterinarios\n*Fácil de montar\n*Incluye un depósito de 108 onzas (3.19394 litros) y un suministro de filtro de 120 días', '1', '2019-05-18 03:22:07', '0000-00-00 00:00:00'),
(11431, 'MLM623026279', 'MLM81645', '522.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'El kit de limpieza Pioneer para mascotas es la herramienta perfecta para mantener su Pioneer Pet Fountain en perfecto estado de funcionamiento. Hace que limpiar y mantener su fuente sea más fácil que nunca. El pequeño cepillo que está escondido en el mango funciona perfectamente para limpiar la bomba y el cepillo grande y la almohadilla de espuma funcionan muy bien para el resto de la fuente.\n\nCaracteristicas:\n2 tamaños de cepillos hacen que la limpieza sea fácil\nLa almohadilla de espuma en la parte superior funciona muy bien en las esquinas\nEl cepillo compacto pequeño hace que el almacenamiento y el uso sean sencillos', '1', '2019-05-18 03:23:13', '0000-00-00 00:00:00'),
