(11451, 'MLM623027052', 'MLM187773', '2354.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Black & Decker bdcdd120 C 20 V max * de litio de velocidad única Drill/Driver\n\nThe Black + Decker bdcdd120 C 20 V Max * driver de litio taladro de velocidad única/permite para colgar fotos, estanterías y más en un instante con este compacto, do-it-all Drill/Driver. Más pequeño y ligero, cabe en espacios reducidos (con un LED de luz a tu manera) mientras que todavía ofrece la potencia necesaria para completar la mayoría de las tareas del hogar. \n\nEl diseño compacto, 35% más pequeño que el driver gc1801 Drill/, te permite para caber en espacios reducidos (detrás de electrodomésticos, interior Interior de gabinetes, closets, etc.).. Esta herramienta es ligero en 2,5 libras y proporciona menos fatiga y hace que sea fácil de mover de una habitación a. El mandril sin llave permite para fácil Bit cambios. \n\nUn embrague de 11-position ayuda a prevenir tornillos para desmontar o dañar materiales y un proyecto de luz LED se ilumina en la superficie. El diseño de mid-handle ayuda a que la broca cómodo de usar. Parte de la 20 V Max * Sistema ', '1', '2019-05-18 03:25:24', '0000-00-00 00:00:00'),
