(11491, 'MLM623029978', 'MLM1161', '19327.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Dark Souls: The Board Game\n\nDark Souls: El juego de mesa es un juego de exploración, combate inmersivo y desafiante estrategia para 1 a 4 jugadores ambientado en el universo de Dark Souls. Los jugadores eligen entre una serie de clases de personajes y exploran peligrosas localizaciones repletas de monstruos, tesoros y mortales peleas contra jefes finales.\n\nIncluye:\n3 miniaturas de jefe\n5 miniaturas de mini-jefe\n4 miniaturas de personaje\n4 miniaturas Grunt grandes\n12 miniaturas Grunt\n7 losetas de tablero de doble cara\n4 tableros de personaje\n3 diales de jefe final para llevar la cuenta del daño\n60 cartas de equipo\n40 cartas de tesoro\n26 cartas de IA de jefe final\n36 cartas de encuentro\n15 dados de colores\n100+ fichas de juego', '1', '2019-05-18 03:29:47', '0000-00-00 00:00:00'),
(11501, 'MLM623180502', 'MLM178309', '849.00', 'MXN', 1, 'buy_it_now', 'gold_pro', 'Son herramientas indispensables para personal de bastones de trekking y senderismo casual Walkers y grave excursionistas, mochileros y Mountaineers por igual. Totalmente ajustable, acortar la Poles sobre la marcha con la simple Twist Lock para escaladas más fácil de hacer de su cuesta arriba. Y para descenso? Sólo tiene que añadir algunas Longitud de ayuda a su descenso.\n\n Mientras que requieren más uso de los brazos, utilizando bastones o un personal más redistribuye Peso de manera uniforme en todo el cuerpo y permite aumentar el senderismo Endurance. Lo que es más, la protección interna primavera alivia el desgaste de los tobillos débiles o dañados, rodillas y caderas. Un único ligero bastón.75 libras. \n\n\nY es de 134,6 cm de largo cuando está completamente extendida, y el diseño telescópico se retrae de todo el camino hacia abajo a 58,4 cm adapta fácilmente a mochilas de muchas formas y tamaños. Cuando se utiliza como un par de bastones de trekking, el agarre ergonómico de plástico no podría ser más cómodo, pero también dispone de un Flared parte superior que permite que cada pole a también ser utilizado como un único Senderismo Personal.\n\n*Ligero, duradero de aluminio telescópica de senderismo\n*Cada sección se bloquea con un simple giro y está marcado con mediciones para ajustes precisos de altura.\n*Muelle antigolpes interno figura en la sección inferior reduce la tensión de hasta el 25% del peso corporal de cuerpo de inferior de las articulaciones y los músculos', '1', '2018-12-23 18:44:49', '0000-00-00 00:00:00'),
(11511, 'MLM623049869', 'MLM4117', '4022.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Lexar JumpDrive memoria USB 3.0 128GB\n\nCaracterísticas:\n*Diseño de bajo perfil y plug-and-stay\n*Almacena y transfiere contenido rápidamente con USB 3.0 Performance (hasta 150mb / s de lectura y 45mb / s de escritura)\n*Protege de forma segura los archivos utilizando el software encrypt stick lite, una solución de seguridad avanzada con cifrado AES de 256 bits\n*Almacena y transfiere fotos, videos, archivos y más de manera confiable\nCompatible con sistemas de pc y mac', '1', '2019-05-18 03:30:54', '0000-00-00 00:00:00'),
(11521, 'MLM623140510', 'MLM108345', '9523.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'El LS2 Stream aplasta a la competencia con sus precios directos de fábrica. Todo comienza con una carcasa ligera y aerodinámica hecha de la aleación de policarbonato HPTT de alto rendimiento patentada de LS2. El forro interior de tela técnica incluye almohadillas cortadas de una pieza sólida de espuma de alta calidad utilizando la tecnología láser 3D de LS2 para un ajuste perfecto y sin \"puntos calientes\". \n\nEs completamente extraíble y lavable para que puedas mantenerlo fresco. (Lave a mano y seque los forros). The Stream tiene la liberación rápida sin herramientas más fácil de usar del mercado, y hace que intercambiar escudos sea muy fácil. El Face Shield es resistente a los arañazos, ópticamente correcto y listo para el bloqueo de pin. Añadimos un Sun Shield desplegable Sun Shield System integrado, para que obtenga un increíble casco a un valor increíble. LS2 tiene su sede en España y es la empresa de casco de crecimiento más rápido del mundo. AJUSTE ES OVAL INTERMEDIO. DOT y ECE aprobados. Está cubierto por una garantía de 5 años contra defectos en materiales y mano de obra.', '1', '2019-05-18 03:32:00', '0000-00-00 00:00:00'),
