(11541, 'MLM623179085', 'MLM178309', '1118.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Este Cascade Mountain Tech Trekking Pole tiene un diseño durable y cómodo de larga duración ya sea en pavimento plano o en un terreno accidentado. El agarre ergonómico EVA se adapta a tu mano como un guante. Correa ajustable grande con un forro interior suave que absorbe la transpiración. El diseño ancho ayuda a eliminar la unión o el pellizco. Configurar su poste de trekking es rápido y fácil. Simplemente gire para bloquear cada sección de poste juntos. Cuando no está en uso, su poste de trepada colapsa para un almacenamiento conveniente. Los ejes de 5 piezas se ajustan fácilmente a su altura. Para una comodidad óptima recomendada para ser utilizada por 5\'5 \"o más alto. El poste incluye puntas extraíbles.\n\nCómodo mango de espuma EVA con correa para la muñeca, agarre ergonómico, espuma de densidad múltiple para amortiguar las vibraciones, absorción de la humedad, rendimiento antideslizante que brinda comodidad durante todo el día\nDURABLE fabricado en aleación de aluminio de calidad superior 7075-T6 para una durabilidad extrema, INCLUIDAS las puntas antideslizantes de acero de tungsteno\n\nBLOQUEO RÁPIDO Ajuste la altura del poste de 44 pulgadas a 54 pulgadas con mecanismo de bloqueo o puede colapsar para almacenar en la mochila\nLas puntas extraíbles incluyen goma circular de empuje y punta de arranque para superficies duras; cestas de nieve con tornillos; y cestas sólidas atornillables para usar en arena y barro\nDimensiones plegadas 13.38 pulgadas desplegadas 54 pulgadas (aprox.) .52 lbs / un polo', '1', '2019-05-18 03:34:12', '0000-00-00 00:00:00'),
(11551, 'MLM623315840', 'MLM148752', '227.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'El colgador de suspensión Swar Arm de Whitmor Manufacturing es ideal para las personas que les gusta mantenerse organizadas. Con este artículo, puede crear espacio colgante vertical en su armario. Se cuelga hasta cinco pares de pantalones, y cuenta con un mecanismo de brazo oscilante para facilitar su eliminación. Esta suspensión está hecha de un acero cromado duradero con barras de acero revestidas de vinilo negro sin enganches para una belleza duradera y confiable. También se puede usar para cinturones, bufandas o corbatas. Esta suspensión cromada es una excelente opción para maximizar el espacio.\n\n*Colección Ebony Chrome\n*Crea espacio colgante vertical adicional en cualquier armario\n*Cuelga hasta cinco pares de pantalones\n*Hace que colgar y quitar los pantalones sea fácil\n*Ahorra espacio y organiza tu armario\n*Robusto y resistente a la herrumbre\n*Diseño escalonado cuelga 5 prendas en espacio de 1\n*Hecho de un material de alta calidad, la suspensión está bien construida y duradera.', '1', '2019-05-18 03:35:18', '0000-00-00 00:00:00'),
(11561, 'MLM623313580', 'MLM54162', '1368.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Agrega extra protección y un toque de color con SeeThru, un estuche rígido para tu MacBook Pro. La funda rígida se encaja en tu MacBook Air en dos piezas, la mantiene segura y es totalmente desmontable. Detalles adicionales como ranuras de ventilación para la liberación de calo y base de goma para mayor estabilidad hacen que esta funda para MacBook Air sea altamente funcional y colorida.\n\n*Se ajusta a todos los modelos Macbook Pro de 13\" (33.02 cm) con Retina Display incluyendo los nuevos modelos 2015\n*Viste tu MacBook Pro con colores vívidos, con un acabado de confite cristalino\n*Estuche que se ajusta; rígido y brillante para evitar las marcas y los rayones\n*Las ranuras de ventilación en la parte inferior y pies de goma anti inclinación evitan que tu MacBook se sobrecaliente\n*Su diseño liviano de dos piezas es fácil de quitar y poner', '1', '2019-05-18 03:36:24', '0000-00-00 00:00:00'),
(11571, 'MLM623312091', 'MLM44627', '2876.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Celestron 21039 Telescopio Powerseeker Refractor, 50/600 mm AZ\n\nEl PowerSeeker 50 AZ es portátil pero potente, por lo que es la opción perfecta para un recién llegado al mundo de la astronomía amateur. La serie PowerSeeker está diseñada para brindar al usuario de telescopio por primera vez la combinación perfecta de calidad, valor, características y potencia. La astronomía amateur es un gran pasatiempo familiar que se puede disfrutar durante todo el año, y los PowerSeekers de Celestron son la opción ideal para un telescopio asequible y de alta calidad que proporcionará muchas horas de diversión para toda la familia.\n\nConfiguración sin herramientas\nCelestron quiere que veas las estrellas ... ¡y rápido! Con una configuración sin herramientas, el telescopio PowerSeeker está listo para usar con un ensamblaje menor. Simplemente retire el telescopio y el trípode de la caja, coloque el tubo del telescopio en el trípode e inserte un ocular. En cuestión de minutos, los objetos celestes comienzan a quedar claros.\n\n¿Qué hay en la caja?\n*Telescopio PowerAZE 50AZ\n*Finderscope\n*3x lente Barlow\n*Oculares: 20 mm, 12 mm, 4 mm\n*Trípode de aluminio\n*Software de astronomía TheSkyX - First Light Edition', '1', '2019-05-18 03:37:32', '0000-00-00 00:00:00'),
