(12011, 'MLM624776755', 'MLM81645', '549.00', 'MXN', 1, 'buy_it_now', 'gold_pro', 'Características:\n\nKellyM Deshedding Glove quita el cabello suelto y masajea suavemente a tus mascotas. Perfecto para perros y gatos de pelo largo o pelo corto y rizado, el Guante Deshedding le permite simplemente quitarse el pelo. El cabello despojado se adhiere al guante, facilitando la limpieza.\n\n*Imita el toque de tu mano para un masaje\n*Incluye 180 puntas de silicona suave para el novio con facilidad\n*Gran removedor de pelo de mascotas para todos los tamaños y la raza\n*Mantenga su casa limpia con el toque de mascota mágica al minimizar el desprendimiento de gatos y perros\n*El cabello se adhiere al guante, lo que hace que sea fácil pelar y tirar el pelo después de la preparación del perro y el gato', '1', '2018-12-23 18:52:51', '0000-00-00 00:00:00'),
(12021, 'MLM624775602', 'MLM126283', '631.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Click-R\nHerramienta de entrenamiento\nLa herramienta manual de adiestramiento Clik-R hace muy divertido y fácil el adiestramiento.\n\nEnseña a tu mascota que un clic significa que va a recibir un premio y automáticamente estará en condiciones de aprender casi cualquier cosa: desde órdenes básicas hasta trucos y agilidad.\n\nLa herramienta de adiestramiento Clik-R incluye una cinta para el dedo que la hace más cómoda y fácil de sujetar durante el entrenamiento que los clickers comunes de caja.\n\nEl Click-R es una herramienta de adiestramiento de gran utilidad, porque un clic seguido de premio es una manera muy clara de decirle a su perro que ha hecho algo bien.\n\nEl sonido del Click-R avisa a tu mascota de que viene algo bueno para ella: ', '1', '2019-05-18 04:15:24', '0000-00-00 00:00:00'),
(12031, 'MLM624774620', 'MLM189964', '631.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Características:\n\n*Cobertor impermeable para asiento de carro mantiene tu carro ordenado mientras transportas tus mascotas\n*Mide aproximadamente 1.42 m de largo x 1.19 m de ancho\n*Protege el asiento trasero de rayones, suciedad, caspa, y derrames\n*Se asegura sobre el reposacabezas con dos aros, 2 anclas de asiento y dos correas elásticas\n*Hecho de 100 % poliéster\n*Limpie solamente las manchas', '1', '2019-05-18 04:16:31', '0000-00-00 00:00:00'),
(12041, 'MLM624771999', 'MLM45923', '791.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Características:\n\nEl bloqueo del volante Club 3100 Twin Hooks forma parte de la línea de productos de calidad The Club de Winner International. Evite que los ladrones profesionales y los jinetes de alegría lleven su vehículo con The Club Twin Hooks.\n\n El Club Twin Hooks se ajusta al volante, haciendo que el vehículo sea imposible de gobernar. Este producto está garantizado por hasta $ 1200.00 contra el deducible de seguro integral del propietario (No válido en el estado de Nueva York, Hawái, Texas o Wisconsin, donde está prohibido por la ley de seguros). Winner International se compromete a proporcionar productos para satisfacer las aplicaciones de seguridad y protección cotidianas. \n\nDesde las cerraduras del volante a las cerraduras de uso general y todos los días, a otras necesidades de seguridad, cuando compra un producto de la marca Club está comprando tranquilidad. Espere un producto fabricado para la seguridad y la seguridad innovadoras y de calidad creadas por un equipo en el que pueda confiar dedicado a servir y construir comunidades más seguras. ¿Por qué puedes esperar esto? -es la misión de Winner International.', '1', '2019-05-18 04:17:36', '0000-00-00 00:00:00'),
(12051, 'MLM624770413', 'MLM126142', '969.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Es la manera conveniente de proporcionar un baño de polvo de chinchilla, jerbos, degus y otros animales pequeños.\n\n*Hecho de plástico resistente\n*Para animales que disfrutan el baño en polvo\n*Fácil de limpiar\n*Ideal para chinchilla, jerbos, degus y otros animales pequeños', '1', '2019-05-18 04:18:42', '0000-00-00 00:00:00'),
(12061, 'MLM624768322', 'MLM189774', '2014.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Características:\n\nWater Rover hace que sea fácil para los dueños de mascotas llevar agua a donde sea que vayan. Con su recipiente de agua durable y liviano y botella adjunta. Water Rover es simple de usar. Simplemente desenchufe la botella, déjela plana, y el agua fluirá automáticamente al recipiente redondo. Vuelva a introducir el agua extra en la botella, vuelva a colocar el enchufe y vuelva a colocar el Water Rover en su cinturón o pretina.\n\n*Manos libres: clips en el cinturón o la cintura\n*Libre de fugas: incluso cuando se mantiene boca abajo\n*Sin residuos: puntas de agua extra en la botella\n*Sin problemas - Botella de boca ancha es fácil de llenar con agua y hielo\n\nDimensiones del producto: 0.8 x 7.6 x 19 cm', '1', '2019-05-18 04:19:49', '0000-00-00 00:00:00'),
(12071, 'MLM624766487', 'MLM126304', '6289.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Características:\n\nEl arnés seguro original para todos: el arnés de seguridad para mascotas # 1 de prueba de choques de Europa. \n\nEl Original All Safe Harness tiene una probada trayectoria de seguridad por más de 15 años en Europa.\n\n La ingeniería alemana combinada con la construcción reforzada de Nylon y acero inoxidable de alta calidad hacen que The Original All Safe Harness sea el arnés de seguridad para mascotas más resistente al choque con la trayectoria más larga de seguridad en el mundo.', '1', '2019-05-18 04:20:54', '0000-00-00 00:00:00'),
(12081, 'MLM624764620', 'MLM189774', '1086.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Características:\n\nLa botella de vidrio para servicio pesado excelente para perros con una botella de agua específica se puede usar con conejos, hurones, aves, conejillos de indias y otros animales pequeños.\n\n La botella de vidrio de pared duradera y gruesa es apta para el lavavajillas.\n\n El agua se mantiene fresca, limpia y sanitaria. N-Ouncezle de 5/8 de pulgada de diámetro con dos bolas de acero inoxidable en la punta. \n\nEl soporte de alta resistencia se adapta a todas las cajas.', '1', '2019-05-18 04:22:00', '0000-00-00 00:00:00'),
(12091, 'MLM624762657', 'MLM189774', '1210.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Descripción del producto:\n\n*Diseño patentado y simple. \n*Depósito de agua fácil de limpiar. \n*El caño de agua produce una corriente continua de bomba sumergible silenciosa que fluye con ajuste de control de flujo.\n* La alfombra opcional atrapa los derrames de agua y proporciona una superficie antideslizante (no incluida). el caño constantemente airea el agua aumentando los niveles de oxígeno que mejora la salud de las mascotas. \n*Transformador listado UL, bajo voltaje, bomba de ahorro de energía.', '1', '2019-05-18 04:23:06', '0000-00-00 00:00:00'),
(12101, 'MLM624760360', 'MLM189774', '616.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Características:\n\n*La capacidad de 40 onzas de agua es ideal para perros pequeños y gatos.\n\n*Proporciona una circulación constante de agua fresca y filtrada.\n\n*Incluye un filtro de agua de carbón reemplazable que elimina los malos sabores y olores, manteniendo el agua fresca.\n\n*Suave flujo de agua es calmante para mascotas aprensivas.\n\n*Fácil de limpiar, apto para lavavajillas y libre de BPA.\n\n*Medidas: 21 x 21.1 x 8.7 cm', '1', '2019-05-18 04:24:12', '0000-00-00 00:00:00'),
(12111, 'MLM624742712', 'MLM189774', '283.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Dispensador portátil de agua para esos grandes paseos junto a tu mascota.\n\nPara uso en exteriores\nFácil de llenar\nFácil de limpiar\nNo se derrama el agua', '1', '2019-05-18 04:25:17', '0000-00-00 00:00:00'),
(12121, 'MLM624740800', 'MLM1090', '623.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Características:\n\n*Superficie grande para el paso de agua a aire para maximizar la oxigenación que da agua más fresca y con mejor sabor.\n*El sistema de recirculación refresca y airea el agua.\n*Consume menos de 4 vatios, utilizando menos energía que una luz de noche.\n*La filtración avanzada purifica el agua, pues absorbe las impurezas del agua como desechos, comida, cabello y sedimentos.\n*Capacidad de agua: 2.96 L (100 oz).', '1', '2019-05-18 04:26:23', '0000-00-00 00:00:00'),
(12131, 'MLM624739611', 'MLM191166', '1278.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Licencia oficial de Nintendo\n\nControl alámbrico para Nintendo Switch edición especial Zelda: Breath of the Wild. Se conecta a la consola via su cable de 3m de longitud. Incluye 6 cubiertas intercambiables para joysticks análogos. Cuenta con licencia oficial de Nintendo.\n\nYa sea que se dirija a The Master Trials, o simplemente comience el viaje de Link, disfrute de la edición Zelda: Breath of the Wild de Wired Controller Plus para Nintendo Switch. Diseñado para el verdadero ventilador Zelda, este controlador presenta agarres de goma suaves al tacto para mayor comodidad y 6 tapas analógicas intercambiables para preferencia personal.', '1', '2019-05-18 04:27:29', '0000-00-00 00:00:00');
