(12431, 'MLM627731246', 'MLM179747', '382.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Harbinger guantes para GYM flexibles TALLA MEDIANA\n\nNOTA: \n*Este producto es importado, por lo tanto tiene un tiempo de envío entre 7 y 15 días.\n\n*Si desea envío rápido, tiene un costo adicional de $200 pesos (Preguntar por disponibilidad).\n\nCARACTERÍSTICAS:\n*Heavy duty StretchBack. Se extiende a través de los dedos y el dorso de la mano para mejorar la ventilación, flexibilidad, comodidad y ajuste.\n\n*Cojines de protección para el pulgar envolventes y cubre el interior del pulgar con una segunda capa de cuero para proteger contra la abrasión.\n\n*El cuero de grano superior invertido en la palma maximiza la resistencia a la abrasión sin comprometer la resistencia al desgarro.\n\n*La palma y los dedos de cuero dobles rodean una capa de espuma elástica para proteger las manos contra la abrasión.\n\n*Doble cosido en todas partes para mayor durabilidad y resistencia a la abrasión', '1', '2019-05-18 04:57:09', '0000-00-00 00:00:00'),
