(12561, 'MLM628649850', 'MLM168706', '3626.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Garmin Vívofit Fitness Monitor de actividad\n\nTe motiva a estar activo durante el día, mostrando una barra roja después de una hora de inactividad. Segmentos adicionales se iluminan después de cada 15 minutos de inactividad. Solo camina un par de minutos para reiniciar la cuenta.\n\nCon estilo, cómodo y extensible resistente al agua que está siempre listo para ir a donde sea.Se mantiene encendido por más de un año sin necesitar cambio de batería.\nRevisa la hora y tus estadísticas desde tu muñeca.Vivofit aprende tu nivel de actividad y te asigna una meta personalizada cada mañana.\n\nCuenta las calorías quemadas durante el día incluyendo las del ritmo metabólico base.\nPonlo en modo \"Sleep\" cuando vayas a dormir para registrar la calidad de sueño.\n\nEn la caja:\nVivoFit con correa grande y pequeña\nUSB ANT Stick\nDocumentación', '1', '2019-05-18 05:07:21', '0000-00-00 00:00:00'),
(12571, 'MLM628647789', 'MLM190763', '723.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'El kit básico negro para Nintendo Switch incluye funda de transporte, 2 carcasas para mandos Joy-Con, protector de pantalla y gamuza limpiadora.\n\nLa funda de transporte con asa se ajusta al dispositivo Nintendo Switch e incluye espacio de almacenamiento para hasta 10 juegos, un soporte incorporado y un bolsillo de malla para accesorios.\n\nLas 2 carcasas de silicona se ajustan de forma segura a los mandos Joy-Con para mayor protección y comodidad.\n\nEl protector de pantalla de cristal templado ofrece resultados antiarañazos gracias a su nivel de dureza 9H.\n\nGamuza para una limpieza fácil de la pantalla.', '1', '2019-05-18 05:08:27', '0000-00-00 00:00:00'),
