(12661, 'MLM631512355', 'MLM190761', '664.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Características:\n\nLa potencia de agarre del clip para Nintendo Switch le permite conectar convenientemente sus Joy-Con Controllers y su teléfono inteligente a un agarre ergonómico que brinda una experiencia óptima mientras utiliza la aplicación en línea de Nintendo. La potencia del agarre del clip se ajustará a la mayoría de los tamaños de teléfonos inteligentes a través del brazo ajustable. Mientras no esté en uso, el brazo ajustable se almacena convenientemente en la parte inferior de la potencia de agarre del clip, lo que permite un agarre Joy-Con más aerodinámico. Almacene hasta 7 juegos de Nintendo Switch y 2 tarjetas microSD en el compartimiento de la potencia de agarre del clip. La batería interna le proporciona tiempo de reproducción adicional para su Joy-Con, teléfono celular o conmutador. La potencia de agarre del clip es la forma ideal de interactuar con la aplicación en línea de Nintendo Switch y jugar al mismo tiempo.', '1', '2019-05-18 05:15:13', '0000-00-00 00:00:00'),
(12671, 'MLM631511545', 'MLM190761', '912.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Características:\nEmpaque fácilmente y viaje de manera inteligente con la bolsa de viaje Hyperkin para Nintendo Switch. ¡Esta bolsa de viaje compacta, protectora y portátil es perfecta para guardar tu conmutador y accesorios en cualquier lugar! La consola y los accesorios se ajustan cómodamente en el área de almacenamiento principal acolchada y en los compartimentos, mientras que el bolsillo trasero con cremallera brinda espacio de almacenamiento adicional. Colóquese su bolso de viaje sobre el hombro para mayor comodidad de manos libres o retire la correa de hombro ajustable de 4 pies y llévela por el asa.', '1', '2019-05-18 05:16:19', '0000-00-00 00:00:00'),
