(12691, 'MLM631506035', 'MLM93862', '1375.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Características:\nEl nuevo Boogie Board Jot 8.5 eWriter presenta una pantalla LCD reflectante ultrabrillante que es 50% más brillante que los modelos anteriores, combinado con un diseño de producto elegante, ultradelgado y ultraligero que lo hace ideal para el hogar, la oficina, la escuela o en marcha. Una aplicación móvil gratuita facilita la captura de copias digitales de sus notas para facilitar el intercambio, la edición y la organización.', '1', '2019-05-18 05:18:33', '0000-00-00 00:00:00'),
