(12761, 'MLM632321227', 'MLM32282', '3769.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Características:\nLos calentadores electrónicos completamente sumergibles NEO-Therm de Cobalt Aquatics cuentan con un diseño moderno y súper plano con un sistema de control \"one touch\" fácil de configurar. El termostato electrónico avanzado tiene una precisión de ± 0.5ºF e incluye un LED que muestra simultáneamente la temperatura establecida y la temperatura del tanque y tiene un rango de temperatura de 66ºF a 96ºF. Para obtener la máxima seguridad y confiabilidad, los circuitos de protección térmica integrados cierran el calentador antes de que se sobrecaliente y su carcasa exterior inastillable hace que el NEO-therm sea virtualmente indestructible. Perfecto para acuarios de agua dulce y agua salada y terrarios', '1', '2019-05-18 05:25:14', '0000-00-00 00:00:00'),
