(12791, 'MLM632317496', 'MLM31570', '637.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Características:\nMantenga los bordes afilados en sus cubiertos con estos aceros de alto rendimiento. Los aceros recubiertos de diamante crean un nuevo bisel en el borde de la cuchilla, dejándolo afilado como una cuchilla.\n Los aceros estándar perfeccionan los cuchillos, eliminando las rebabas de los bordes de las cuchillas. Mercer, un nombre de empresa muy apreciado en el comercio culinario, es sinónimo de calidad, cubiertos profesionales.\n Líder en la industria por más de 30 años y el proveedor predominante de más del 90% de las academias culinarias en América del Norte, Mercer le ofrece las mejores herramientas utilizadas por la industria. Mercer, de renombre mundial, históricamente ha proporcionado educación culinaria y chefs profesionales, que han llegado a depender de la compañía para sus distintas ofertas de productos. A medida que las artes culinarias continúan ganando popularidad, las nuevas ofertas de productos de Mercer le han permitido a la compañía expandir su marca y cruzarse en el mercado de consumo. Los consumidores domésticos cada vez más sofisticados buscan los mismos productos utilizados por los profesionales y los productos Mercer no solo son de alta calidad profesional, sino que tienen una ventaja de valor distinta. \nEl sello distintivo de Mercer Cutlery: calidad excepcional en materiales, diseño único y artesanía dedicada, perfeccionada a las exigentes necesidades de rendimiento del exigente chef, hace de Mercer la opción innegable tanto para el profesional como para el entusiasta.', '1', '2019-05-18 05:28:31', '0000-00-00 00:00:00');
