(12941, 'MLM633787368', 'MLM178338', '884.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Características:\nGlowCitys LED Light Up Football tiene una calidad como ninguna otra. A diferencia de esperar un brillo en el fútbol oscuro para cargar bajo la luz, nuestras bombillas LED inteligentes son instantáneas.\nIMPACTO ACTIVADO: Toda la bola se ilumina desde el interior creando un fútbol intensamente brillante que se apaga automáticamente cuando no está en uso.\nCALIDAD DURADERA: Nuestros balones de fútbol están bien hechos y son perfectos para los juegos nocturnos. Se sorprenderá de la diversión que tendrá con esta pelota jugando de noche.\nBATERÍAS INCLUIDAS: ¡Listo para usar, simplemente llénelo de aire y prepárese para sorprenderse! Nuestro LED activado por impacto preinstalado estará listo para jugar. Las baterías también son reemplazables para un uso continuado.\nGARANTÍA DE SERVICIO AL CLIENTE: GlowCity se ocupa de sus clientes y ofrecemos una garantía de 60 días sin problemas de reparación o sustitución si algo sale mal o deja de funcionar con su Fútbol.', '1', '2019-05-18 05:39:38', '0000-00-00 00:00:00'),
