(13311, 'MLM633128537', 'MLM29984', '418.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Esta Marvel Comics Capitán América Shield acero inoxidable Anillo es producto oficial y dispone de un color rojo y azul esmalte de culata acero inoxidable alivio de la shield de Capitán con el logotipo de la Avenger de cada lado. Este anillo hará que un maravilloso regalo para cualquier fan de o el universo Marvel Capitán América. Cada Anillo es presentada en su propia caja regalo a juego. Disponible en varios tamaños.\n\n*Producto oficial.\n*Escudo de Capitán América con alivio de incrustaciones de esmalte rojo y azul.\n*Avenger de símbolo en los lados\n*Viene en una caja de regalo de temática\n*Tamaño número 12', '1', '2019-05-18 06:13:40', '0000-00-00 00:00:00'),
