(13331, 'MLM631714706', 'MLM30675', '6194.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Características:\nEste moderno reloj inteligente híbrido Armani Exchange presenta una esfera de rayos de sol de acero inoxidable con agujas e índices negros, una caja de acero inoxidable cepillado y una correa de cuero marrón mate. Las principales características tecnológicas incluyen seguimiento de actividad, notificaciones de teléfonos inteligentes, controles de música, actualizaciones automáticas de huso horario y más.\n\n*No se requiere carga / 6 meses de duración de la batería, personalizables: controle su música, tome una foto\n*Material de la banda: cuero Color de la banda: marrón Tamaño de la caja: 47 x 53 mm Grosor del caso: *10 mm Resistencia al agua: 5 cajeros automáticos\n*Mmovimiento de cuarzo\n*Diámetro de la caja: 53 mm', '1', '2019-05-18 06:15:52', '0000-00-00 00:00:00'),
(13341, 'MLM631701567', 'MLM189458', '303.00', 'MXN', 99, 'buy_it_now', 'gold_pro', '¡¡¡IMPORTANTE!!!! \n\nTodos nuestros productos tienen envío GRATIS \n\nSeleccionar la opción de \"RETIRO EN DOMICILIO DEL VENDEDOR\" y nosotros te mandaremos mensaje para que nos proporciones tus datos de envío \n\nTRADEMARK HIDDEN WALL SAFE\n¿Quieres un escondite para documentos pequeños, joyería, tarjetas de crédito u objetos personales?\n\n*Luce como un simple contacto eléctrico pero en realidad es un gran lugar para esconder tus objetos valiosos.\n*Hecho con material de plástico y metal de alto impacto.\n*Fácil instalación en pocos minutos\n*Una vez instalado solo jala hacia afuera para ver tu escondite secreto.', '1', '2019-05-18 06:16:57', '0000-00-00 00:00:00'),
