(13361, 'MLM631151055', 'MLM189578', '1120.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Descripción del vendedor\nCaracterísticas:\n*Hecho de cuero y tela de PU de alta calidad, resistente y a prueba de polvo\n*Está diseñado con cremallera de costura para facilitar el acceso y la seguridad de sus lápices de arte, útiles escolares y de oficina\n*Hay una banda elástica en cada columna que se divide en muchas ranuras (totalmente 150 ranuras) para sostener, organizar y proteger tus lápices\n*Bolsa de lápiz de almacenamiento de múltiples capas puede poner varios lápices de colores / acuarela, marcadores pequeños, lápices de dibujo y plumas\n*La práctica correa de la manija es fácil de transportar y conveniente para usar en casa, al aire libre, en el trabajo o en el viaje\n\nPresupuesto:\nMaterial: cuero y tela de PU\nRanura: 150 ranuras\nColor: rojo purpúreo\nTamaño: 28.5 x 20.5 x 5cm / 11.22 x 8.07 x 1.96 pulgadas\nEl paquete incluye: 1 x Estuche de lápices (los lápices no están incluidos)\nNota:\nLos monitores no están calibrados del mismo modo, el color del elemento que se muestra en las fotos puede mostrar un poco diferente del objeto real. Por favor tome el real como estándar.', '1', '2019-05-18 06:19:09', '0000-00-00 00:00:00'),
(13371, 'MLM628648207', 'MLM190763', '944.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Deluxe Detalles del producto:\n\nEstuche de viaje Deluxe. Sostiene y protege el conmutador Nintendo.\n Divisor acolchado para proteger la pantalla con un bolsillo de malla con cremallera para tarjetas de juego adicionales. Duradera carcasa rígida 1680D para máxima protección. Cómodo asa de transporte. Tarjeta de juego roja transparente Case 2 pcs. Cada caja contiene 4 Nintendo Switch Game Cards.\n\n La carcasa de la tarjeta Micro SD se adapta a cualquier sección de la carcasa de la tarjeta de juego. Protección libre de polvo. Rojo Transparente Tarjeta Micro SD Case 2 pcs. Cada caja contiene 2 tarjetas Micro SD y cabe en cualquier sección de la funda de la tarjeta de juego. Protección libre de polvo.', '1', '2019-05-18 06:20:14', '0000-00-00 00:00:00'),
(13381, 'MLM626887029', 'MLM118812', '494.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Características:\n\nIngrese su número de modelo arriba para asegurarse de que esto se ajuste.\nCómoda mini mini sartén y mini turner de nylon Prestige (r) hacen el par perfecto para tareas rápidas y eficientes de cocción y calentamiento de una sola porción.\n\nLa antiadherente de cerámica blanca en negrita en el interior proporciona una liberación excepcional de alimentos y una superficie de cocción de alta visibilidad PFOA, PTFE y cadmio.\n\nLa miniexcavadora construcción de aluminio duradera brinda un calentamiento rápido y uniforme, y la robusta asa de doble remache proporciona un soporte sólido.\n\nHorno seguro a 350 grados Fahrenheit (con excepción de Turner) y apto para lavavajillas: el lavado de manos es más fácil que las barras antiadherentes tradicionales o el acero inoxidable; Garantía limitada de por vida, y el conjunto proporciona otra adición inteligente y colorida a todos los excelentes utensilios de cocina SilverStone (r)', '1', '2019-05-18 06:21:20', '0000-00-00 00:00:00'),
(13391, 'MLM624239151', 'MLM189457', '1960.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Nearly Natural Planta artificial de Ágave Look Realista/Natural\n\nLleva la naturaleza adentro con este hermoso y exuberante Agave. \n\nDe pie 30 \"de alto, con una variedad de hojas espinosas y audaces que apuntan en todas direcciones, esta planta parece que la has estado fumando durante años (el hecho de que nunca necesita agua será nuestro secreto). \n\nSe completa con una hermosa maceta negra , lo que lo convierte en una pieza de acento ideal tanto para el hogar como para la oficina. Es un buen regalo también.', '1', '2019-05-18 06:22:28', '0000-00-00 00:00:00'),
(13401, 'MLM622844319', 'MLM1152', '482.00', 'MXN', 99, 'buy_it_now', 'gold_pro', '¡Mini juego de arcade con auténticos sonidos de arcade y joystick de estilo que se comporta como el verdadero Pac-Man! ¡Con dos modos de juego geniales, puedes mover el joystick para comer los puntos y comer y correr! Incluye 2 pilas AA.\n\n¡Regresa a la diversión y a la nostalgia de los años 80 con los minijuegos de réplica exacta!\nJoy stick control, 2 modos de juego y gráficos y sonidos auténticos hacen que el juego sea tan emocionante como el original.', '1', '2019-05-18 06:23:36', '0000-00-00 00:00:00'),
(13411, 'MLM625089177', 'MLM31565', '417.00', 'MXN', 99, 'buy_it_now', 'gold_special', 'Características:\n\n*Variedad de estilos de bloque de cuchillo y nueva e innovadora Home cocineros permiten personalizar su colección de cubiertos.\n\n*Calidad superior cuchillas de acero inoxidable de carbono para precisión y exactitud\nprecision-tapered muy afiladas cuchillas de tierra que estrecho gradualmente a un, Fine Edge.\n\n*Con asas para fácil, cómodo Corte\n\n*Garantía de por vida', '1', '2019-05-18 06:24:44', '0000-00-00 00:00:00'),
(13421, 'MLM632801651', 'MLM32282', '1683.00', 'MXN', 99, 'buy_it_now', 'gold_special', 'Características:\n\nLos sensores de temperatura dual proporcionan temperaturas de agua precisas y en tiempo real\nPantalla LCD de temperatura disponible tanto en Fahrenheit como en Celsius; Rango de 68 a 93 grados Fahrenheit\n\nTecnología de calor rápido construida con un cierre de seguridad; Protección integrada para peces para proteger a los peces e invertebrados\n\nEquipado con un soporte de montaje de perfil delgado; Sistema de alerta de pantalla a color\n\nAdecuado para acuarios de hasta 100 galones, 300 vatios; 5 años de garantía\n\nConsulte el manual del usuario en Detalles del producto antes de usar el artículo.\n\nEl calentador está calibrado de fábrica. Variables tales como temperatura ambiente más baja, grandes fluctuaciones, falta de una cubierta de acuario, presencia de bombas y filtros sumergibles, colocación de acuarios en las proximidades de fuentes de refrigeración, pueden requerir un mayor vataje para un control adecuado.\n\n Los volúmenes indicados son valores aproximados que corresponden a temperaturas del agua de hasta 26 ° C / 78 ° F con una temperatura ambiente de 20 ° C / 68 ° F. Si la temperatura ambiente es superior a la temperatura establecida de al menos 1 ° C / 2 ° F, o fuentes externas de calor elevan la temperatura del acuario a más de 1 ° C / 2 ° F, la pantalla LCD permanecerá roja hasta que cambien las condiciones', '1', '2019-05-18 06:25:53', '0000-00-00 00:00:00'),
