(13661, 'MLM643990796', 'MLM9893', '8992.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Características:\n\nLittle Tikes Jump \'n Slide \n\nLos niños pueden saltar, deslizarse y rebotar en este gorila inflable Little Tikes Jump \'n Slide. Un diseño de casa divertido e hinchable ofrece un área grande para varios niños y un tobogán divertido. El Jump \'n Slide Bouncer se inflará en minutos y se doblará de forma compacta para facilitar el almacenamiento.\n\n  Área de salto grande: 12 \'x 9\'\n  Las paredes altas con malla de malla rodean una gran área de salto.\n  Paredes de malla para proteger a los niños, y le permiten ver la diversión.\n  Después del inflado, el soplador debe funcionar continuamente mientras los niños juegan.\n  Bouncer debe estar firmemente anclado en su lugar antes de saltar.\n  Los accesorios incluyen: bolsa de almacenamiento, soplador resistente con enchufe GFCI, kit de reparación, 4 estacas de ventilador, 6 estacas de gorila.\n  Número máximo de niños: 3\n  Límite máximo de peso combinado: 250 lbs.', '1', '2019-05-18 06:45:51', '0000-00-00 00:00:00'),
