(13821, 'MLM644431463', 'MLM187079', '1345.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Características:\nEl Little Tikes 2 en 1 Snug Secure Swing es para niños a los que les encanta bailar. Este columpio para bebés de Little Tikes es la combinación perfecta de seguridad y comodidad. A los padres afectuosos les encantarán todas las características de seguridad diferentes que se encuentran en el columpio Little Tikes. Una barra en T y correas mantienen al niño seguro en su lugar y se pueden quitar a medida que el niño crece. ¡Es un columpio para bebés y un columpio para niños pequeños en uno! Características: - Barra en T que gira hacia abajo para facilitar la carga y descarga. - Correas de hombro ajustables que sujetan al bebé de forma segura en su lugar. Si se usa con un niño que no requiere la barra en T o las correas, las correas se mueven hacia la parte inferior. del columpio y tienda convenientemente fuera del camino - Límite de peso de hasta 50 lbs.', '1', '2019-05-18 07:01:14', '0000-00-00 00:00:00'),
