(13861, 'MLM644390745', 'MLM187079', '3607.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Características:\n Hazte a este precio mientras usted puede. Guarda los recuerdos, pero evita las rozaduras. Este columpio es una solución más fuerte, más seguro para el neumático columpios de las últimas décadas. Nuestra columpio se puede colgar de cualquier rama de árbol de apoyo para proporcionar horas de diversión de balanceo.\nTiene capacidad para hasta 99.8 kilogram. Resistencia a la tracción cuerda de polietileno es resistente a los rayos UV, y no se estira ni se mancha. Tubos de acero pulverizado hace que este columpio más fuerte y más ligero que un neumático, sino también la estructura acolchada es cómodo y seguro para los niños.\nIncluye todos los accesorios para colgarlo de un columpio tradicional o de cualquier árbol de apoyo. Compruebe lista de imágenes.\nDimensiones del producto: 61 cm (diámetro)\nKHOMO Gear es una marca registrada y ventas de productos al aire última intervensión.', '1', '2019-05-18 07:05:38', '0000-00-00 00:00:00'),
