(14731, 'MLM647678731', 'MLM168680', '3738.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Descripción del producto:\n\nEl lavabo mide 83.82cm x 55.88cm x 22.86cm de profundidad; un orificio de grifo pre-perforado\n  \n Instalación de montaje dual; se puede colocar por debajo o por debajo; instalación fácil de colocar; no se requieren clips\n  \n La superficie duradera, dura y no porosa es resistente al calor, los arañazos y las astillas\n  \n El respaldo de fibra de vidrio proporciona resistencia y estabilidad adicionales, ayuda a mantener la temperatura del agua y actúa como una barrera de sonido para los trituradores de alimentos.\n  \n Los lavamanos de piedra compuesta tienen un acabado resistente a las manchas y al óxido y son fáciles de limpiar con limpiadores no abrasivos', '1', '2019-05-18 08:34:07', '0000-00-00 00:00:00'),
