(15361, 'MLM651942499', 'MLM194645', '7998.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'El Master-Touch de 22 pulgadas incluye un termómetro integrado en la tapa para que midas la cocción de tus alimentos y queden a la perfección.\n\n No sufras por el humo que se genera, la ventila de acero inoxidable resistente a la corrosión que tiene la tapa, ayudará a que éste salga sin problemas. \n\nTambién tiene cenicero de aluminio removible, para que te deshagas de los restos del carbón sin sufrir accidentes. \n\nAdemás es perfecto para llevar a todos lados, ya que sus 2 ruedas permiten transportarlo fácilmente. Ademas cuenta con 10 años de garantia.', '1', '2019-05-18 09:21:46', '0000-00-00 00:00:00'),
(15371, 'MLM651939438', 'MLM194645', '5899.00', 'MXN', 50, 'buy_it_now', 'gold_pro', 'Características:\n\n Sistema de control de presión de flujo perfecto para calor constante, incluso en el frío\n\nPortable parrilla se configura en segundos\n\nFácil de transportar, se pliega al tamaño compacto con gran asa y ruedas para facilitar el transporte\n\nAsar a la parrilla sabor auténtico, open-flame drip-through asar a la parrilla\n\nSuperficie de cocción grande, 285 sq. in.(sq. cm)', '1', '2018-12-23 19:00:50', '0000-00-00 00:00:00'),
(15381, 'MLM652187781', 'MLM189780', '779.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Características:\n\nFuente decorativa, con bomba incorporada y esfera de luz\n  \n Se puede usar en el interior o exterior, es ideal para centro de mesa y jardines\n  \n Una fuente suele ser el elemento principal de un altar o de un espacio consagrado a la naturaleza\n \n Contiene fuente de 2 vasijas chicas\n\nDimensiones del producto: 22 x 19.5 x 29 cm ; 1.63 Kg', '1', '2019-04-01 18:07:53', '0000-00-00 00:00:00'),
(15391, 'MLM652160391', 'MLM189780', '549.00', 'MXN', 50, 'buy_it_now', 'gold_pro', 'Características:\n\n Opciones de energía dual, lo que permite el funcionamiento sobre estándar Pin 1 adaptador de 3 V o 2 pilas AA (no incluidas. (adaptador y pilas no incluidas)\n  \n Viene con dos luces LED de color ámbar, flujo de agua en la pizarrón ladrillo\n \n Piedras de río incluido para adicional belleza\n \n Perfecto regalo grab and Go para cualquier ocasión de día festivo y una buena elección para interior y exterior \n\nDecoración\n \n relajantes sonidos de reducir el estrés corrientes de agua y aportar una sensación de bienestar', '1', '2018-12-23 19:00:51', '0000-00-00 00:00:00'),
(15401, 'MLM652157011', 'MLM189780', '800.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Características:\n\nSe ejecuta automáticamente, sin batería o electricidad necesaria, sólo el sol (Energía del panel solar: 1.4W)\n \n Viene con 3 cabezas de aerosol diferentes para el reemplazo\n  \nTres suckers en el fondo para pegarse en el agua(Vertical spray hasta 30-50 cm)\n  \n Coloque la bomba totalmente en el agua con su boquilla sobre el agua, asegúrese de que la bomba está \n\nfirmemente fija en la parte inferior de la fuente para evitar la vibración(Velocidad Máxima: 180 L / H)\n  \nPuede ser utilizado para el baño del pájaro, estanque pequeño, decoración del jardín, circulación del agua para el oxígeno', '1', '2019-05-18 09:22:55', '0000-00-00 00:00:00'),
(15411, 'MLM652877732', 'MLM194647', '3199.00', 'MXN', 50, 'buy_it_now', 'gold_pro', 'Características:\n\n*8 espátulas especialmente diseñadas para retirar los alimentos de las bandejas de raclette fácilmente y sin pegarse\n\n*¡8 sartenes grandes para queso raclette, postres y más!\n\n*Superficie antiadherente para asar carnes, pescados y verduras.', '1', '2018-12-23 19:00:52', '0000-00-00 00:00:00'),
(15421, 'MLM652792735', 'MLM85016', '416.00', 'MXN', 99, 'buy_it_now', 'gold_pro', '¡¡¡IMPORTANTE!!!!    \n    \nTodos nuestros productos tienen envío GRATIS    \n    \nSeleccionar la opción de \"RETIRO EN DOMICILIO DEL VENDEDOR\" y nosotros te mandaremos mensaje para que nos proporciones tus datos de envío    \n    \n*El envío es por paquetería privada o por DHL    \n**Se cuenta con la opción de envío express teniendo un costo de $50 pesos extra y un tiempo de entrega al siguiente día (pregunta por disponibilidad).    \n***Evita la cancelación de tu compra por no escoger la opción de RETIRO EN DOMICILIO DEL VENDEDOR.    \n\nCaracterísticas:\nCabeza de poder con filtro rápido. \nCaracterísticas: \nDiseño compacto, completamente sumergible, filtración mecánica y biológica, montura ajustable para cualquier acuario, cartucho modular intercambiable, filtración biológica adicional, para uso en acuarios de agua dulce o marinos. \nRendimiento: \nModelo: Aqua-jet 10F \nWatts: 10 watts. \nVolts: 120V-60 Hz. \nL x hr: 480 L/hr. \nBeneficios: \nSe obtiene un buen control de desechos, manteniendo y mejorando la calidad del agua. \nPrecauciones: \nLa bomba debe permanecer sumergida constantemente mientras opera. Al limpiar la bomba, asegúrese de desconectarla del suministro eléctrico, para uso en interiores únicamente.', '1', '2019-05-18 09:24:03', '0000-00-00 00:00:00'),
(15431, 'MLM627731696', 'MLM178309', '999.00', 'MXN', 1, 'buy_it_now', 'gold_pro', 'DESCRIPCI', '1', '2018-12-23 19:00:54', '0000-00-00 00:00:00'),
(15441, 'MLM653161148', 'MLM189780', '2715.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Características:\n\nModerno con giro clásico.\n\nDimensiones aproximadas:25.5016 x 25.5016x 40 CM\n\nAñade elegancia a cualquier habitación.', '1', '2019-05-18 09:25:10', '0000-00-00 00:00:00'),
(15451, 'MLM653156092', 'MLM189780', '1404.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Características:\n\nACENTO DECORATIVO: La fuente de meditación eléctrica SereneLife para interiores y exteriores es una elegante pieza de decoración del hogar que se adapta al mostrador de cocina, mesa de salón o computadora de oficina. Añade un bonito valor a cualquier espacio que seguramente sorprenderá a tus invitados.\n\nRELAXACI', '1', '2019-05-18 09:26:16', '0000-00-00 00:00:00'),
(15461, 'MLM653154026', 'MLM189780', '7781.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Características:\n\nDimensiones totales: 10.5 pulgadas de ancho x 20 pulgadas de largo x 25.5 pulgadas de alto; \n\nDimensiones del tazón: 16.5 pulgadas de diámetro; Profundidad del tazón de 6 pulgadas; pesa 27 libras.\n\nLa fuente exterior está hecha de un material de poliresina que es liviano y fácil de mover. * Los colores pueden variar ligeramente de las imágenes en pantalla. La configuración del monitor de la computadora y diferentes entornos de iluminación pueden hacer que el color del producto aparezca de manera diferente.\n\nIncluye una luz LED que se encuentra en la parte inferior de la taza, y una bomba eléctrica sumergible JR-1100LV con un diámetro de manguera de 0,5 pulgadas, por lo que no se requieren tuberías. Todo lo que tiene que hacer es conectarlo a una toma de corriente externa estándar.\n\nEl agua fluye desde la abertura rectangular de 6.5 pulgadas de largo en la parte superior de la fuente, donde fluye suavemente hacia el recipiente debajo de donde recircula de nuevo a través de la fuente con la ayuda de la bomba eléctrica. Tenga en cuenta que cuando llene el recipiente necesitará verter agua adicional en el orificio de acceso posterior ubicado en la parte posterior de la fuente de agua para asegurarse de que la bomba esté completamente sumergida bajo el agua.', '1', '2019-05-18 09:27:21', '0000-00-00 00:00:00'),
(15471, 'MLM653144915', 'MLM189780', '719.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Características:\n\nADENTRO DECORATIVO: La fuente exterior de meditación para interiores SereneLife Electric es una elegante pieza de decoración para el hogar que cabe en el mostrador de la cocina, la mesa de la sala o el escritorio de la oficina. ¡Agrega un hermoso valor a cualquier espacio que seguramente cautivará a sus invitados!\n\nRELAJACI', '1', '2019-05-18 09:28:27', '0000-00-00 00:00:00'),
