(15501, 'MLM653352226', 'MLM159681', '11198.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'CARACTERÍSTICAS:\n\nCombinación de memory foam y viscoelastic. Todas ellas antimicrobianos.\n\nEmpacado al vacío y en una caja para que puedas llevarlo con facilidad.\n\n¡Sin movimientos! Neutraliza tu movimiento y el de tu pareja, permitiendo un mejor descanso.\n\nHipoalergénico, no provoca reacciones en la piel, no causa alergias.\n5 años de garantía', '1', '2019-05-18 09:31:45', '0000-00-00 00:00:00'),
