(15521, 'MLM653586530', 'MLM79511', '520.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Nuestra linternas led recargables ofrece múltiples ventajas en relación a las linternas tradicionales. Las luces led que utiliza son amigables con el medio ambiente, no sólo por su duración sino porque también son reciclables y representa un gran ahorro de dinero por el bajo consumo de energía que tiene; lo que aumenta significativamente el tiempo de uso que puede tener la linterna led recargable sin que se agote la batería y tener que volverla a cargar.\n\nCaracterísticas:\n\nMaxi LED de 2 W\nPráctico panel de 12 LEDs\nDos intensidades de luz\nHasta 18 horas de iluminación continua en modo panel (Panel con 12 leds)\nHasta 12 horas de iluminación continua en luz baja\nHasta 8 horas de iluminación continua en luz alta\n\nTensión: 127 V\nFrecuencia: 60 Hz\nConsumo: 1W\nBatería Recargable 4 V-/600 mAh', '1', '2019-05-18 09:33:56', '0000-00-00 00:00:00'),
(15531, 'MLM653526108', 'MLM159684', '2184.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'CARACTERÍSTICAS:\n\nColchón de espuma de memoria de 5.1.cm con 5.zonas de cuerpo para maximizar el confort\n\nEspuma con memoria de forma está impregnada con el relajante aroma de lavanda y con textura para mejorar la transpirabilidad\n\nCuerpo texturizado zonas reducir monitoreo en diferentes puntos de contacto para evitar las molestias\n\nFórmula de espuma de memoria está diseñado para ser extremadamente suave, esponjoso y sensible', '1', '2019-05-18 09:35:02', '0000-00-00 00:00:00'),
(15541, 'MLM653521090', 'MLM159681', '2578.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'CARACTERÍSTICAS:\nEl colchón de espuma de memoria con gel de 4 pulgadas LUCID agrega vida nueva y mejora la comodidad de un colchón existente. \n\nEl colchón más grueso y lúcido de Lucid, esta capa ultra gruesa y cómoda está hecha de espuma de memoria con gel de felpa para una comodidad suprema.\n\nLa espuma de memoria LUCID se comprime uniformemente debajo del peso y la forma únicos de un cuerpo, ajustándose a las curvas para aliviar la presión en los hombros y las caderas. La espuma de alta calidad está impregnada con material de gel avanzado que captura y distribuye el calor para una temperatura de sueño más cómoda.\n\n El cubrecolchón tiene un diseño ventilado que mejora la transpiración para un sueño reparador.', '1', '2019-05-18 09:36:10', '0000-00-00 00:00:00'),
(15551, 'MLM653699398', 'MLM180884', '4995.00', 'MXN', 1, 'buy_it_now', 'gold_pro', 'Descripción:\n\nXbox One S 500gb (OJO: NO INCLUYE JUEGOS DEBIDO A QUE EL MINECRAFT VENIA DIGITAL Y YA FUE CANJEADO)\n\nLa consola seria reseteada de fábrica \n\nLa consola se compró en Diciembre de 2017, solamente se uso disco físico con dos juegos de ahi en fuera se ha utilizado puros juegos digitales, en este caso solo Fortnite y juegos de Gamepass (esta es la razón por la que no incluye juegos), por tal razón la lectora esta en muy buen estado. Ninguna falla al momento. \n\nIncluye:\n*Caja \n*1 Control\n*Cables originales\n*Consola', '1', '2018-12-23 19:01:06', '0000-00-00 00:00:00'),
(15561, 'MLM644829183', 'MLM49295', '3834.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'CARACTERÍSTICAS:\nCapacidad de 2 cuartos Paleta mejorada con un tiempo de procesamiento más rápido Panel de control con 3 configuraciones con múltiples velocidades Boquilla para ingredientes con taza de medición integrada Garantía limitada de 3 años', '1', '2019-05-18 09:37:15', '0000-00-00 00:00:00'),
(15571, 'MLM645739016', 'MLM158379', '7050.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Información del producto:\n\n*Control ajustable del dial del termostato\n\n *Compartimiento congelador\n\n *Luz interior\n\n*Dos piernas de nivelación\n\n*Puerta reversible', '1', '2019-05-18 09:38:21', '0000-00-00 00:00:00'),
(15581, 'MLM653532679', 'MLM151399', '400.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Características:\n\nEste conjunto incluye un (1) espejo grande de 9 pulgadas, tres (3) espejos medianos de 6 pulgadas y tres (3) espejos pequeños de 3 pulgadas\n\nCada espejo tiene un borde redondeado que le da un aspecto limpio y no intrusivo que agrega un toque sutil a cualquier decoración\nAgrupe los espejos para crear un collage o colgar por separado para obtener un aspecto versátil y personalizado\n\nEstos espejos son livianos y fáciles de colgar para una instalación rápida y fácil en cualquier pared\n\nConstruido de vidrio y con un pequeño gancho en la parte trasera para colgar (tornillos / clavos no incluidos)', '1', '2019-05-18 09:39:27', '0000-00-00 00:00:00'),
(15591, 'MLM653837866', 'MLM159683', '17584.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Características:\n\n*60 noches de prueba y 20 años de Garantía\n\n*GEL MEMORY FOAM:Un material fresco que se adapta al contorno de tu cuerpo eliminando los puntos de presión\n\n*Tela de origen Holandes con terminado ANTIACAROS y frescura THERMO GEL FINISH con la humedad de tu cuerpo baja 2°c la temperatura.\n\nCubierta con cierre perimetral para facilitar su lavado', '1', '2019-05-18 09:40:33', '0000-00-00 00:00:00'),
(15601, 'MLM653833996', 'MLM159681', '965.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Características:\nEl colchón de 1.5 pulgadas con espuma de memoria de té verde Zinus mejorará la comodidad de su colchón con espuma de memoria adaptable y de apoyo. \n\nNo se incluye una cubierta, ya que nuestra cubierta de espuma con memoria puede caber debajo de cualquier sábana estándar o de bolsillo profundo.\n\n La última evolución de la espuma de memoria, el biofoam reemplaza parte del petróleo tradicional con aceite vegetal natural, e incluye extracto de té verde natural y todo el carbón activo natural para ayudar a absorber la humedad, eliminar los olores y mantener fresco el colchón. \n\nAbra el paquete de su colchón dentro de las 72 horas posteriores a la recepción y deje que transcurran 48 horas para que su nuevo colchón vuelva a su forma original y elegante. Preocupación libre de 5 años limitada. Otra innovación de confort de Zinus.', '1', '2019-05-18 09:41:39', '0000-00-00 00:00:00'),
(15611, 'MLM653833737', 'MLM159683', '13670.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Características:\n\nColchón Xpand es el colchón diseñado para ti, con 3 capas de memory foam para un soporte y descanso ideal.\n\nLa capa superior compuesta de espuma HR, otorgando un confort y soporte balanceado para un descanso completo.\n\nLa segunda capa consiste de viscogel memory foam premium. La frescura del gel ayuda a adaptarse a la temperatura de tu cuerpo, ayudando a optener un descanso sin interrupciones. El colchón se amolda a tu cuerpo, aislando el movimiento para no despertar a tu pareja.\n\nLa tercera capa es el núcleo Xpand con soporte inteligente, otorgando durabulidad y establidad cada noche.\n\nTela strech removible, anti-ácaros, para un mayor flujo de aire para un descanso fresco. Tamaño matrimonial: 1.90m X 1.35m X 24 cm.', '1', '2019-05-18 09:42:45', '0000-00-00 00:00:00'),
(15621, 'MLM654051611', 'MLM118812', '842.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'El revestimiento antiadherente evita que los alimentos se peguen a la sartén, por lo que es fácil para todos cocinar takoyaki y mucho más.\nMaterial grueso que almacena el calor bien haciendo que el sabor de la comida sea delicioso.\nDimensiones del extermal: 260 mm de ancho x 210 mm de profundidad x 39 mm de alto. Peso del producto: aprox. 730 g.\nMaterial: aleación de aluminio, superficie superior antiadherente.', '1', '2019-05-18 09:43:53', '0000-00-00 00:00:00');
