(15631, 'MLM654040154', 'MLM149338', '1262.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'UGREEN USB Tipo C Multi-port HUB Puede extender sus computadoras portátiles / teléfonos inteligentes a:\n\nUn puerto de carga rápida de 60W USB C PD 3.0 / PD 2.0 (20V / 3.25A, 15V / 3A, 9V / 2A, 5V / 2A)\nUn puerto de salida de video HDMI 4K @ 30hz / 1080p @ 60Hz\n3 Puertos USB 3.0, que es un compañero para computadoras portátiles / teléfonos inteligentes USB c.\n\nDispositivos compatibles (lista incompleta):\n\nMacBook Pro 2017 / MacBook Pro 2016 / Nueva MacBook 2016 / MacBook Air2018\nDell XPS13 / XPS15 / Inspiron 15 7000 / Inspiron 13 7000\nHP Spectre 13 / Spectre X360 / ENVY 13 / ENVY X360 / HP EliteBook Folio G1\nASUS Chromebook Flip / ZenBook3 / ASUS ZenBook Pro / ASus ZenBook Flip / ASUS Transformer 3 Pro T303UA / ASUS ZenFone 3 Ultra / Liquid Jade Primo\nGoogle ChromePixelbook\nLenovo Yoga 920/910/720\nHuawei Matebook /Mate 20 Pro P20 Pro Mate 10 Pro\nSamsung Galaxy Book / S9 / S8 / S8 Plus / Note 8\nLG G5 / G4 / V20 / V30\nHTC One U11 / 10 OnePlus 3/2\nBlackBerry DTEK60\nNOTA: la carga rápida de PD es solo para computadoras portátiles, pero no para celulares S9 / S8 / LG / HTC, etc. Los celulares solo admiten carga normal\n\nMás seguro y duradero\n\nPara ser más duradero y más seguro que el cubo de plástico, UGREEN adopta el diseño de aleación de aluminio y sistemas multiprotec exclusivos.\nComo protección de cortocircuito de entrada y salida/protección de alta temperatura / coincidencia de corriente automática, etc.\nEn comparación con la caja de plástico, la carcasa de aluminio tiene una mejor disipación térmica, lo que significa que el calor se produjo en el interior cerca de un chip, componente electrónico y los circuitos se conducirían al exterior más rápidamente, haciendo que este adaptador sea más seguro pero más caliente (lo cual es normal) que la carcasa de plástico.\nNOTA IMPORTANTE\n\n1. Este cubo de aluminio USB C será un poco más caliente que el cubo de plástico, que es normal, al igual que su loptop / memoria flash / teléfono inteligente de aleación de aluminio estará caliente después de un largo tiempo de uso.\n2. Cargar la computadora portátil a través de nuestro concentrador será un poco más lento que cargando directamente a través del cargador de pared, ya que este concentrador costará alrededor de 7.5W para trabajar)\n3. Para la salida de video 4K, solo admite una frecuencia de actualización de 30Hz y NO admite una frecuencia de actualización de 60Hz. Besiedes, el cable hdmi debe ser inferior a 5 m para video 4k\n4. NO le recomiendo que cargue el teléfono a través del puerto USB ya que el puerto USB solo puede ofrecer 1.5A de corriente y cargará su teléfono lentamente.\n5. NO use 2 discos duros simultáneamente o muchos dispositivos que consumen mucha energía a través del puerto USB', '1', '2019-05-18 09:44:59', '0000-00-00 00:00:00'),
(15641, 'MLM654039964', 'MLM149338', '1582.00', 'MXN', 99, 'buy_it_now', 'gold_pro', '8 EN 1 HUB ADAPTADOR Multi-Conector puerto USB-C 3.1 a 4K@30HZ HDMI salida , Gigabit Ethernet, Micro SD (TF) y lector de tarjetas SD, 3 USB 3.0 y la carga USB-C PD Power Delivery. (Máx. 20V 3A). Es el complemento para Macbook /Macbook Pro/air2018, chromebook Google, Dell XPS, Lenovo Yoga 900, portátil HP Spectre, asus ZenBook, Huawei Matebook/Mate 20 Pro P20 Pro Mate 10 Pro y Samsung S9 S8/Plus que solo dispone de un puerto USB tipo C para todo, sea cargar portátil, transmitir datos o reproducir vídeo\n\n4K VÍDEO SALIDA La toma HDMI saca audio de alta definición y vídeo hasta Ultra HD 4K@30HZ y Full HD 1080p@60HZ, y podrías conectar tu portátil directamente a una TV o pantalla y disfrutarás de una calidad nítida, precisa y de alta definición en pantallas grandes. Ideal para llevar a cabo tareas que requieren alta resoluciones, al hacer presentaciones durante reuniones, conferencias o clases, ver vídeos en casa, etc.\n\nHUB DE M', '1', '2019-05-18 09:46:04', '0000-00-00 00:00:00'),
