(15791, 'MLM649933980', 'MLM182246', '622.00', 'MXN', 99, 'buy_it_now', 'gold_special', 'Características:\n\n*UGREEN funda para disco duro externo viene a proteger sus 2.5\" discos duros portátiles y varios otros accesorios durante el desplazamiento diario, teniendo sus datos valiosos bien protegidos contra posibles golpes, caídas o arañazos.\n\n*En esta funda caben perfectamente todas las unidades de disco duros externos de 2.5 pulgadas de WD, Seagate, Toshiba, Samsung, como Western Digital Elements, Western Digital My Passport, Toshiba Store Basics, Toshiba Canvio Basic, Seagate Backup Plus Slim, etc.\nEn el interior cuenta con varios compatimentos con redecilla o con cinta elástica, en los que puede meter más accesorios además del disco duro, entre ellos, cables, tarjetas SD/TF, pendrive, adaptadores USB, auriculares, pequeñas baterías portátiles, etc.\n\n*El material EVA con lo que está hecho es semi-rígido y suave al tacto, lo que no sólo ofrece adecuada protección para su disco duro y los contenidos metidos, sino también crea una carcasa con acabados elegantes y sencillos estéticamente.\n\nEl tamaño adecuado y la ligereza de la funda también atribuyen a suficiente portabilidad para meterse en cualquier mochila, bolsa o maletín. Encima, con el fiable cierre de cremallera puede trasladarla a cualquier lugar con toda seguridad.', '1', '2019-05-18 10:00:21', '0000-00-00 00:00:00'),
(15801, 'MLM655052511', 'MLM151397', '549.00', 'MXN', 50, 'buy_it_now', 'gold_pro', 'Características:\n\nColgador de llaves con portacartas de sencillo diseño \n\n¿Por qué InterDesign? InterDesign trae innovación, estilo y organización a su hogar gracias a una amplia gama de productos. \n\nNuestro objetivo es mejorar y embellecer su entorno. Nos inspiramos en las tendencias de moda actuales para crear colecciones que aúnan la practicidad con la funcionalidad de sus diseños. \n\nDescubra ahora nuestra extensa selección de productos para el cuarto de baño, la cocina, el dormitorio, ¡y mucho más! Sobre la gama York Lyra: Los organizadores de esta serie convencen por la perfecta armonía entre su alta funcionalidad y su elegancia, con pequeños detalles sofisticados e inspirados\n\n. El diseño sencillo y clásico hace que estos productos se adapten a todos los hogares. Además, estos sistemas de almacenaje están realizados en metal de primera calidad, con gran variedad de modelos para elegir. \n\nDiscreto organizador de pared: Este colgador metálico, que ahorra espacio en el recibidor o la cocina, consta de un cuelga llaves y un portacartas para dejar el correo. \n\nEn la cesta metálica abierta de este panel organizador se pueden dejar las cartas entrantes y salientes, así como otros objetos pequeños.\n\n Los seis ganchos para colgar llaves ofrecen mucho espacio y permiten guardar todas las llaves.\n\n Gracias al material de montaje incluido en el pedido, el estante de pared se fija en poco tiempo en el lugar deseado. Número de artículo: 54270EU Material: metal Medidas: 21,6 cm x 5,8 cm x 27,2 cm', '1', '2018-12-23 19:01:54', '0000-00-00 00:00:00'),
(15811, 'MLM655046962', 'MLM151397', '883.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Características:\n\n*El estante para tocador Moen Preston ofrece un diseño simple y sutil para complementar el motivo de tu baño.\n\n* Con un diseño de vidrio y metal discreto pero elegante, este estante para tocador de baño combina a la perfección con el resto de la colección Preston de productos Moen para una apariencia limpia y coordinada. \n\n*Y gracias a un acabado cromado altamente reflectante, este tocador de baño complementa una amplia variedad de decoración\n\n*Estantería de tocador de baño Preston de estilo sencillo.\n\n*Combina perfectamente con la colección de accesorios de baño Preston.\n\n*Accesorios de montaje y plantilla guiada incluidos para una fácil instalación.\n\n*Acabado en cromo espejo.', '1', '2019-02-04 19:14:56', '0000-00-00 00:00:00'),
