(16190, '', 'MLM1499', '216.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Guante del artista con 2 dedos. - Talla universal adecuada para llevar puesta en la mano derecha o la mano izquierda. - Especialmente diseñado para el uso con lápiz óptico de respuestas tabletas gráficas y pantallas de tableta. - Reduce la fricción entre la mano y la superficie de la tableta, evitando que tu mano activen funciones en las tabletas sensibles al tacto. - El paquete contiene un guante.', '1', '2019-01-29 21:08:41', '2019-01-23 18:23:07'),
(16191, '', 'MLM1499', '494.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Dewalt tough coat hard coated lens provides tough protection against scratches - Dewalt XtraClear anti-fog lens coating provides tough protection against fogging - Soft, dual injected rubber conforms to the face to provide a high level protection from dust and debris - Polycarbonate lens meets ANSI z87.1+ Standards and provides 99.9% UVA/UVB protection - Ventilation channels allow breathability and added protection against fogging - Built-in ventilation channel provides extra fog control and ventilation - Dual injected rubber provides a soft, comfortable seal - Clip attachment allows for easy lens replacement - Cloth head strap provides a comfortable, easily adjustable fit - Tough, polycarbonate lens provides impact resistance.', '1', '2019-02-04 19:18:27', '2019-01-23 18:23:33'),
(16192, '', 'MLM1574', '683.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'freshware vasos desechables son resistentes tazas se ofrece en un transparente taza para añadir un toque de diversión a comidas de diario o un toque festivo a la decoración de tu fiesta con no limpiar. Si usted está lanzando una fiesta de piscina, oficina fiesta para niños, fiesta o sólo quiere mantener las cosas fácil para su próxima familia Get Together, Trust freshware para todas las necesidades de tu fiesta.', '1', '2019-05-18 01:02:01', '2019-05-18 00:32:00'),
(16194, '', 'MLM1574', '437.00', 'MXN', 99, 'buy_it_now', 'gold_pro', 'Freshware yh-7023 reusable 20-pack to-go 7-inch round medium food container with lid - microwave, freezer, and dishwasher safe, 24 ounce is highly recommended by fitness experts, these convenient bento lunch boxes with clear lids are designed for easy meal prep. They are versatile food containers that are microwavable and easy to stack in coolers and picnic baskets or other areas with limited storage space. The leak-resistant lid keeps delicate foods fresh with a raised design that allows you to top off your favorite foods. These food containers are great for sandwiches, pizza, pasta, chips, fruits, and more. Box size: 7.3 Inch diameter x 1.6 Inch height. Cavity size: 6.5 Inch diameter x 1.6 Inch height. Volume: 24 oz. Lid size: 7.3 Inch diameter x 0.5 Inch height. Made of polypropylene, these boxes are 100% BPA, PVC, and phthalate free! the material is specially designed for both heat and cold resistance with its thick walls keeping cold items cold and hot items hot. The unique patented shell-finish design provides a cool-to-the-touch feel. Easily store and display multiple containers in your freezer by stacking them for neat presentation of your cooked frozen foods. These reusable containers are microwavable for quick and easy reheating. They are temperature safe from -40 to 250 degrees Fahrenheit (-40 to 121 degrees Celsius) and are microwave, freezer, and dishwasher safe. These containers are versatile and can also be used to store arts and crafts as well as small toys. Use the compartments to divide crafts and materials by color or size or organize home repair items such as nails or screws. The clear lid provides easy viewing of contents.', '1', '2019-05-18 01:02:05', '2019-05-18 00:37:47');
